import React from 'react'

const TodoList = ({todos}) => {
    
  return (
    <div>
        {todos.map((item,index)=>(
            <p key={index}>{item}</p>
            
        ))}
        <div>
          <button>Edit</button>
          <button onClick={handleDelete}>Delete</button>
        </div>

    </div>
  )
}

export default TodoList
